import React from 'react';
import styled from 'styled-components';
import banner from '../images/productsbg.jpg';

const Products = () => {
	return (
		<ProductsWrapper>
			<div className='banner'>
				<img src={banner} alt='' />
			</div>
			<div className='products-title'>Products</div>
		</ProductsWrapper>
	);
};

export default Products;

const ProductsWrapper = styled.section`
	position: relative;
	top: 70px;
	.banner {
		width: 100%;
		height: 250px;
	}
	.banner img {
		width: 100%;
		height: 100%;
	}
`;
